// import React from "react";

let lunchOptions = ['Padmini\'s', 'H-Mart', 'Ledo\'s', 'The Garage', 'Shawn\'s House'];

function LunchOptionButton() {
    return (
        <button>-THE GODS WILL DECIDE-</button>
    );
}

export default function LunchChooser() {
    return (
        <div className="choiceBody">
            <h2>Where will you be going for lunch today?</h2>
            <LunchOptionButton />
            <p></p>
        </div>
    );
}
